    const data = response.json();
    console.log(data);
  })


  return (
    <>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>State Name</TableCell>
            <TableCell>Helpline Number</TableCell>
          </TableRow>
        </TableHead>

      </Table>
    </>
  );
}

export default App;
